"use strict";

// index of the current section
var sectionIndex = 0; // defferent available section

var section1 = document.querySelector(".section.index-1");
var section2 = document.querySelector(".section.index-2");
var section3 = document.querySelector(".section.index-3");
var sections = [section1, section2, section3]; // next and back buttons for changint the section

var next = document.querySelector(".next");
var back = document.querySelector(".back"); // selection of different sections

var selection1 = document.querySelector(".selection li:nth-child(1)");
var selection2 = document.querySelector(".selection li:nth-child(2)");
var selection3 = document.querySelector(".selection li:nth-child(3)");
var selections = [selection1, selection2, selection3]; // address and number

var addressButton = document.querySelector(".header .address-button");
var numberButton = document.querySelector(".header .number-button");
var address = document.querySelector(".address");
var number = document.querySelector(".number"); // checks if next and back buttons should be displayed

function checkNextAndBack(sectionIndex, sectionsLength) {
  if (sectionIndex === 0) {
    next.classList.add("active");
    back.classList.remove("active");
  } else if (sectionIndex === sectionsLength - 1) {
    next.classList.remove("active");
    back.classList.add("active");
  } else {
    next.classList.add("active");
    back.classList.add("active");
  }
} // change the selection section with next and back buttons


function changeSelection(newIndex) {
  selections[sectionIndex].classList.remove("active");
  selections[newIndex].classList.add("active");
} // changes the section to next section


function goNext(sectionIndex) {
  if (sectionIndex >= sections.length - 1) {
    return sectionIndex;
  }

  sections[sectionIndex].classList.remove("active");
  var newIndex = sectionIndex + 1;
  sections[newIndex].classList.add("active");
  checkNextAndBack(newIndex, sections.length);
  changeSelection(newIndex);
  return newIndex;
} // changes the section to perviuos section


function goBack(sectionIndex) {
  if (sectionIndex <= 0) {
    return sectionIndex;
  }

  sections[sectionIndex].classList.remove("active");
  var newIndex = sectionIndex - 1;
  sections[newIndex].classList.add("active");
  checkNextAndBack(newIndex, sections.length);
  changeSelection(newIndex);
  return newIndex;
} // selections


selections.forEach(function (selection, selectionIndex) {
  selection.addEventListener("click", function () {
    if (sectionIndex === selectionIndex) {
      return;
    }

    sections[sectionIndex].classList.remove("active");
    checkNextAndBack(selectionIndex, sections.length);
    changeSelection(selectionIndex);
    sectionIndex = selectionIndex;
    sections[sectionIndex].classList.add("active");
  });
});
next.addEventListener("click", function () {
  sectionIndex = goNext(sectionIndex, sections);
});
back.addEventListener("click", function () {
  sectionIndex = goBack(sectionIndex, sections);
}); // show and hide address and number

addressButton.addEventListener("click", function () {
  addressButton.classList.toggle("active");
  address.classList.toggle("active");
});
numberButton.addEventListener("click", function () {
  numberButton.classList.toggle("active");
  number.classList.toggle("active");
});

